import React, { useEffect, useState } from 'react';
import axios from 'axios';
import ''

function NewsBoard() {
  const [news, setNews] = useState([]);

  useEffect(() => {
    axios.get('http:/localhost:4444/api/news').then((response) => {
      setNews(response.data);
    });
  }, []);

  return (
    <div>
      <h1>News Board</h1>
      {news.map((article) => (
        <div key={article._id}>
          <img
            src={article.images[0]}
            alt="news"
          />
          <h2>{article.title}</h2>
          <p>{article.content}</p>
        </div>
      ))}
    </div>
  );
}

export default NewsBoard;
